USE sales;
CREATE TABLE IF NOT EXISTS sales_2013( sales_id INT NOT NULL AUTO_INCREMENT PRIMARY KEY, dealer_id INT, agent_id VARCHAR(9), owner_id INT, sales_type ENUM('new','used'), vin VARCHAR(25),  price_sold FLOAT, price_list FLOAT, dealer_cost FLOAT, sales_year INT, sales_month VARCHAR(3), sales_day TINYINT UNSIGNED, model_year INT, model_name VARCHAR(15) );
